                        <p>
                            The volt is named after Alessandro Volta. As with every SI unit named for a person, its symbol starts with an upper case letter (V), 
                            but when written in full, it follows the rules for capitalisation of a common noun; i.e., volt becomes capitalised at the beginning of 
                            a sentence and in titles but is otherwise in lower case.
                        </p>
